import { useState } from 'react';
import logo from '../../images/logo.png';
import dropdown from '../../images/sort-down.png'
import '../../style/App.css';
import SwitchList from './SwitchList';
import UserInfo from './UserInfo';

function App() {
  const [username, setUsername] = useState<string>("Sally")

  return (
    <div className="App">
      <header className="App-header">
        <img className='logo' src={logo} alt='' />
        <nav>
          <li>Home<img src={dropdown} alt=''/></li>
          <li>Dashboard<img src={dropdown} alt='' /></li>
          <li><UserInfo username={username}/><img src={dropdown} alt='' /></li>
        </nav>
      </header>
      <div className='mid-container'>
        <SwitchList username='Sally'/>
      </div>
    </div>
  );
}

export default App;
